  return (
    <>
      <div className="w-full lg:w-8/20 mx-auto mb-4">
          <CardSettings />
        </div>
        {/*
        <div className="w-full lg:w-4/12 px-4">
          <CardProfile />
        </div>
        */}
      
    </>
  );
}
